import './App.css';

function App() {
    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/rules" element={<Rules />} />
                <Route path="/sample" element={<Sample />} />
                <Route path="/scores" element={<Scores />} />
            </Routes>
        </Router>
    );
}

export default App;
